public class Solution {
    public int[] LexicographicallySmallestArray(int[] nums, int limit) {
        bool[] visited = new bool[nums.Length];
        for (int i = 0; i < nums.Length; i++) {
            if (visited[i]) continue;
            int minVal = nums[i], minIndex = i;
            for (int j = i + 1; j < nums.Length; j++) {
                if (!visited[j] && Math.Abs(nums[i] - nums[j]) <= limit && nums[j] < minVal) {
                    minVal = nums[j];
                    minIndex = j;
                }
            }
            if (minIndex != i) {
                // Swap the elements
                nums[minIndex] = nums[i];
                nums[i] = minVal;
                visited[minIndex] = true; // Mark the swapped element as visited to avoid cyclic swaps
            }
        }
        return nums;
    }
}
